import React from 'react';
import {
  Box,
  Typography,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper
} from '@mui/material';

const FormComponent2 = ({ title, subjectsData, idLabel = 'Roll Number' }) => {
  const [name, setName] = React.useState('Naveen Kumar');
  const [sod, setSod] = React.useState('Ravi Kumar');
  const [idValue, setIdValue] = React.useState('21P31A12A7');
  const [dob, setDob] = React.useState('2002-07-14');
  const [submissionDate, setSubmissionDate] = React.useState('2025-06-24');

  const subjects = subjectsData;

  const totalMaxMarks = subjects.reduce((sum, s) => sum + s.maxMarks, 0);
  const totalMinMarks = subjects.reduce((sum, s) => sum + s.minMarks, 0);
  const totalSecuredMarks = subjects.reduce((sum, s) => sum + Number(s.secured || 0), 0);

  return (
    <Box sx={{ p: 3, maxWidth: 800, margin: '0 auto' }}>
      <Typography variant="h6" gutterBottom>{title}</Typography>

      <Typography><strong>Name:</strong> {name}</Typography>
      <Typography><strong>S/o or D/o:</strong> {sod}</Typography>
      <Typography><strong>{idLabel}:</strong> {idValue}</Typography>
      <Typography><strong>Date of Birth:</strong> {dob}</Typography>
      <Typography><strong>Date of Submission:</strong> {submissionDate}</Typography>

      <TableContainer component={Paper} sx={{ mt: 3 }}>
        <Table>
          <TableHead>
            <TableRow sx={{ backgroundColor: '#dddddd' }}>
              <TableCell>Subject</TableCell>
              <TableCell align="right">Max Marks</TableCell>
              <TableCell align="right">Min Marks</TableCell>
              <TableCell align="right">Marks Secured</TableCell>
              <TableCell>Result</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {subjects.map((subject, index) => (
              <TableRow key={index}>
                <TableCell>{subject.name}</TableCell>
                <TableCell align="right">{subject.maxMarks}</TableCell>
                <TableCell align="right">{subject.minMarks}</TableCell>
                <TableCell align="right">{subject.secured}</TableCell>
                <TableCell>{subject.result}</TableCell>
              </TableRow>
            ))}
            <TableRow sx={{ backgroundColor: '#dddddd' }}>
              <TableCell><strong>Grand Total</strong></TableCell>
              <TableCell align="right"><strong>{totalMaxMarks}</strong></TableCell>
              <TableCell align="right"><strong>{totalMinMarks}</strong></TableCell>
              <TableCell align="right"><strong>{totalSecuredMarks}</strong></TableCell>
              <TableCell />
            </TableRow>
          </TableBody>
        </Table>
      </TableContainer>
    </Box>
  );
};

export default FormComponentAnesthesia;
